import { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../../styles/admin.css';

export default function AdminPanel() {
  const [routes, setRoutes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const token = localStorage.getItem('token');  // Получаем токен из localStorage

  useEffect(() => {
    if (!token) {
      navigate('/admin/login');  // Если нет токена, редиректим на страницу логина
      return;
    }

    fetchRoutes();  // Загружаем маршруты
  }, [token]);

  const fetchRoutes = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/admin/routes', {
        headers: {
          Authorization: `Bearer ${token}`,  // Добавляем токен в заголовок
        },
      });

      setRoutes(response.data);
    } catch (err) {
      setError(err.response?.data?.message || 'Ошибка загрузки маршрутов');
      if (err.response?.status === 401) {
        localStorage.removeItem('token');
        navigate('/admin/login');  // Если авторизация не прошла, редиректим на страницу логина
      }
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');  // Удаляем токен при выходе
    navigate('/admin/login');
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/admin/routes/${id}`, {
        headers: {
          Authorization: `Bearer ${token}`,  // Добавляем токен для удаления маршрута
        },
      });
      await fetchRoutes();  // Перезагружаем маршруты
    } catch (err) {
      setError(err.response?.data?.message || 'Ошибка при удалении');
    }
  };

  if (loading) return <div className="loading">Загрузка...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="admin-container">
      <header className="admin-header">
        <h1>Панель администратора</h1>
        <button onClick={handleLogout} className="logout-btn">
          Выйти
        </button>
      </header>

      <div className="routes-list">
        <h2>Список маршрутов</h2>
        {routes.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>Откуда</th>
                <th>Куда</th>
                <th>Дата</th>
                <th>Цена</th>
                <th>Действия</th>
              </tr>
            </thead>
            <tbody>
              {routes.map(route => (
                <tr key={route._id}>
                  <td>{route.from}</td>
                  <td>{route.to}</td>
                  <td>{new Date(route.date).toLocaleDateString()}</td>
                  <td>{route.price} ₽</td>
                  <td>
                    <button 
                      onClick={() => handleDelete(route._id)}
                      className="delete-btn"
                    >
                      Удалить
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Нет доступных маршрутов</p>
        )}
      </div>
    </div>
  );
}
